class Record(Mo):
    """
    An immutable object that records a state transition for a fault instance object. Record creation is triggered by fault:Inst object creation or deletion,  or by modification of key properties (for example, severity, lifecycle, or acknowledgement). Because an object of this class is immutable, all properties are set at the time the object is created. A record contains a complete snapshot of the fault instance object and is logically organized as a  flat list under a single container. The record object contains properties from  the corresponding instance object (fault:Inst) such as severity (original,  highest, and previous), acknowledgement, occurrence, and lifecycle as well as  inherited properties that provide a snapshot of the fault instance and the  nature and time of its change. The record is meant to be queried using  time-based filters or property filters for severity, affected DN, or other  criteria. NOTE: The properties of the fault record object must be kept in sync with the properties of the  fault instance object.

    """

